package com.ortona.stefano.leetcode.adventofcode;

import java.util.HashSet;
import java.util.Objects;
import java.util.Set;
import java.util.Stack;

public class Day5 {

  public static void main(String[] args) {
    final Day5 day5 = new Day5();
    System.out.println(day5.getPolymerLenghtAfterReaction("aA"));
    System.out.println(day5.getPolymerLenghtAfterReaction("abBA"));
    System.out.println(day5.getPolymerLenghtAfterReaction("abAB"));
    System.out.println(day5.getPolymerLenghtAfterReaction("aabAAB"));
    System.out.println(day5.getPolymerLenghtAfterReaction("dabAcCaCBAcCcaDA"));

    final String realInput = "";
    System.out.println(day5.getPolymerLenghtAfterReaction(realInput));

    System.out.println(day5.getShortestPolymerByRemovingOneElement(realInput));

  }

  public int getShortestPolymerByRemovingOneElement(String polymer) {
    // firt compute all elements
    final Set<Character> allElements = new HashSet<>();
    for (int i = 0; i < polymer.length(); i++) {
      // add only lower cases letters
      final char curChar = polymer.charAt(i);
      if ((curChar >= 'a') && (curChar <= 'z')) {
        allElements.add(curChar);
      }
    }
    int minLength = polymer.length() + 1;
    for (final Character c : allElements) {
      minLength = Math.min(minLength, getPolymerLenghtAfterReaction(polymer, c));
    }
    return minLength;
  }

  public int getPolymerLenghtAfterReaction(String polymer) {
    return getStackPolymerAfterReaction(polymer, null).size();
  }

  public int getPolymerLenghtAfterReaction(String polymer, Character elementToAvoid) {
    return getStackPolymerAfterReaction(polymer, elementToAvoid).size();
  }

  private Stack<Character> getStackPolymerAfterReaction(String polymer, Character elementToAvoid) {
    // modify the input string and replace all characters reduced with *
    final Stack<Character> nonReactedElements = new Stack<>();
    for (int i = 0; i < polymer.length(); i++) {
      final char curElem = polymer.charAt(i);
      if (Objects.isNull(elementToAvoid) || ((curElem != elementToAvoid) && !isReaction(curElem, elementToAvoid))) {
        if (nonReactedElements.isEmpty() || !isReaction(nonReactedElements.peek(), curElem)) {
          nonReactedElements.add(curElem);
        } else {
          // remove from the stack the first element
          nonReactedElements.pop();
        }
      }
    }
    return nonReactedElements;
  }

  private boolean isReaction(char a, char b) {
    // there are exactly 32 characters difference between same letter with different case
    return Math.abs(a - b) == 32;
  }

}
